import React from 'react';
import styled from 'styled-components';


const NavClient = styled.nav`
    width: 20vw;
    height: 100vh;
    overflow: hidden;
    content: '';
    display: flex;
    flex-direction: column;
    background-image: url('/navbackground.png');
    background-size: cover;
`;

export default function NavBar() {
    return (
        <NavClient>
            <div> hello </div>

        </NavClient>
    )
}
